  //todo attack
  //todo destroy card
  //todo gainPoints
  //todo win
  //todo lose

  return (
    <View style={tw`h-full flex flex-col `}>
      <Player1 />
      <Image
        style={[ styles.logo, tw`` ]}
        source={require("../assets/images/pokeball.png")}
      />
      <Player2 />
      <StatusBar hidden />
    </View>
  );
}
const styles = StyleSheet.create({
  logo: {
    width: 70,
    height: 70,
    position: "absolute",
    top: "50%",
    left: "50%",
    transform: [ { translateX: -35 }, { translateY: -32 } ],
    zIndex: 99,
  },
  player2: {
    backgroundColor: "#ED5564",
    borderTopWidth: 5,
    borderTopColor: "#434A54",
  },
});
